* Kapuluan ng Kalayaan en filipino, literalmente ‘Archipiélago de la Libertad’; 
* Nánshā Qúndǎo en pinyin, o 南沙群岛 en chino; literalmente ‘Archipiélago de las Arenas del Sur’; 
