* Trường Sa en vietnamita, literalmente ‘Arenas Largas’; Estas islas son conocidas por ser zona de un territorio en disputa entre varios países por el Conflicto territorial en el mar de la China meridional. La China continental, Taiwán y Vietnam reclaman la totalidad del archipiélago, mientras que Malasia y Filipinas reclaman una parte. Estas cinco naciones han ocupado militarmente diversas islas como testimonio de su soberanía en la zona. Brunéi también ha ocupado algunos arrecifes del sur del archipiélago, pero no ha hecho una reclamación formal de estos.​
